import React from 'react';

function Conocenos() {
  return (
    <div className="container mt-5">
      <h2>Conócenos</h2>
      <p>Bienvenido a la sección "Conócenos". Aquí puedes conocer más sobre nuestra historia y misión.</p>
    </div>
  );
}

export default Conocenos;
